import React, {Component} from 'react';

class Data extends Component {
    constructor(props) {
        super(props);
        this.state = {
            item: [],
            isLoaded: false,
        }
    }

    componentDidMount() {
        fetch('https://jsonplaceholder.typicode.com/users')
            .then(res => res.json())
            .then(json => {
                this.setState({
                    isLoaded: true,
                    items: json,
                })
            });
    }

    render() {

        var { isLoaded, items} = this.state;

        if (!isLoaded) {
            return (
                <div>Loading...</div>
            )
        } else {
            let id1 = items.map(item => {
                if(items.id == '1') {
                    return (
                        <div>
                            <ul>
                                <li>
                                    name: {item.name}
                                </li>
                            </ul>
                        </div>
                    )
                }
            })
        }

    }

}
export default Data;
